import { LineChart, Line, XAxis, YAxis, Tooltip, Legend } from 'recharts'

const data = [
    {
        name: '11/2020',
        uv: 4000,
        pv: 2400,
        amt: 2400,
    },
    {
        name: '12/2020',
        uv: 3000,
        pv: 1398,
        amt: 2210,
    },
    {
        name: '01/2021',
        uv: 2000,
        pv: 9800,
        amt: 2290,
    },
    {
        name: '02/2021',
        uv: 2780,
        pv: 3908,
        amt: 2000,
    },
    {
        name: '02/2021',
        uv: 1890,
        pv: 4800,
        amt: 2181,
    },
    {
        name: '03/2021',
        uv: 2390,
        pv: 3800,
        amt: 2500,
    },
    {
        name: '04/2021',
        uv: 3490,
        pv: 4300,
        amt: 2100,
    },
    {
        name: '05/2021',
        uv: 3490,
        pv: 4300,
        amt: 2100,
    },
]

export default function Rechart() {
    return (
        <LineChart
            width={600}
            height={400}
            data={data}
            margin={{ top: 5, right: 20, bottom: 5, left: 0 }}
        >
            <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
            <Line
                type="monotone"
                dataKey="pv"
                stroke="#8884d8"
                activeDot={{ r: 8 }}
            />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
        </LineChart>
    )
}
